import React, { useState } from "react";
import { MatchResult } from "../HomePage";
import MolImage from "./MolImage";

interface SmartsFilterResultProps {
  matchCounts: MatchResult[];
  mode: string;
  totalMatched: number;
  batch: boolean;
  view: boolean;
}

const SmartsFilterResult: React.FC<SmartsFilterResultProps> = ({
  matchCounts,
  batch,
  view,
}) => {
  const [expandedGroups, setExpandedGroups] = useState<{ [key: string]: boolean }>({});
  const [rowsPerGroup, setRowsPerGroup] = useState<{ [key: string]: number }>({});

  if (matchCounts.length === 0) return null;

  const toggleGroup = (groupName: string) => {
    setExpandedGroups((prev) => ({
      ...prev,
      [groupName]: !prev[groupName],
    }));
  };

  const handleRowsChange = (groupName: string, value: number) => {
    setRowsPerGroup((prev) => ({
      ...prev,
      [groupName]: value,
    }));
  };

  const groupByFilter = (data: MatchResult[]) => {
    const groups: { [key: string]: MatchResult[] } = {};
    data.forEach((item) => {
      const filter = item.filterName || "Custom";
      if (!groups[filter]) groups[filter] = [];
      groups[filter].push(item);
    });
    return groups;
  };

  const groupedResults = groupByFilter(matchCounts);

  if (!batch) {
    // fallback non-batch paginated view (if needed)
    return (
      <div className="container mt-4">
        <h3>Results ({matchCounts.length} molecules processed)</h3>
        <div className="table-responsive">
          <table className="table table-striped table-hover table-bordered">
            <thead className="table-dark">
              <tr>
                <th>#</th>
                <th>Name</th>
                {view && <th>Structure</th>}
                <th>Filter</th>
                <th>Result</th>
              </tr>
            </thead>
            <tbody>
              {matchCounts.map((result, idx) => (
                <tr
                  key={idx}
                  className={result.failed ? "table-danger" : "table-success"}
                >
                  <td>{idx + 1}</td>
                  <td>{result.name}</td>
                  {view && (
                    <td>
                      <MolImage smiles={result.SMILES} />
                    </td>
                  )}
                  <td>{result.filterName || "Custom"}</td>
                  <td>{result.failed ? "Fail" : "Pass"}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    );
  }

  return (
    <div className="container mt-4">
      <h3>Results ({matchCounts.length} molecules processed)</h3>

      {Object.entries(groupedResults).map(([filterName, groupResults]) => {
        const isExpanded = expandedGroups[filterName] ?? true;
        const totalFails = groupResults.filter((r) => r.failed).length;
        const rowsToShow = rowsPerGroup[filterName] || 5;
        const paginatedResults = groupResults.slice(0, rowsToShow);

        return (
          <div key={filterName} className="mb-4 border rounded p-2">
            <div
              className="d-flex justify-content-between align-items-center"
              onClick={() => toggleGroup(filterName)}
              style={{ cursor: "pointer" }}
            >
              <h5 className="mb-0">
                {isExpanded ? "▼" : "▶"} {filterName} ({totalFails} hits)
              </h5>
            </div>

            {isExpanded && (
              <>
                <div className="d-flex align-items-center gap-2 my-2">
                  <label htmlFor={`rows-${filterName}`} className="mb-0">
                    Show entries:
                  </label>
                  <select
                    id={`rows-${filterName}`}
                    className="form-select form-select-sm"
                    style={{ width: "auto" }}
                    value={rowsToShow}
                    onChange={(e) => handleRowsChange(filterName, parseInt(e.target.value))}
                  >
                    {[5, 6, 7, 8, 9, 10].map((num) => (
                      <option key={num} value={num}>
                        {num}
                      </option>
                    ))}
                  </select>
                </div>
                <div className="table-responsive">
                  <table className="table table-bordered table-sm">
                    <thead className="table-light">
                      <tr>
                        <th>#</th>
                        {view && <th>Structure</th>}
                        <th>Molecule Name</th>
                        <th>Result</th>
                      </tr>
                    </thead>
                    <tbody>
                      {paginatedResults.map((item, idx) => (
                        <tr
                          key={idx}
                          className={item.failed ? "table-danger" : "table-success"}
                        >
                          <td>{idx + 1}</td>
                          {view && (
                            <td>
                              <MolImage smiles={item.SMILES} />
                            </td>
                          )}
                          <td>{item.name}</td>
                          <td>{item.failed ? "Fail" : "Pass"}</td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              </>
            )}
          </div>
        );
      })}
    </div>
  );
};

export default SmartsFilterResult;
